// 单独的内部 diff 函数
function diffInternal(obj1, obj2, path = '') {
    const differences = [];

    // 检查第一个对象的键
    for (const key in obj1) {
        if (obj1.hasOwnProperty(key)) {
            const fullPath = path ? `${path}.${key}` : key;
            if (!obj2.hasOwnProperty(key)) {
                differences.push(`Key "${fullPath}" is missing in second JSON.`);
            } else if (typeof obj1[key] === 'object' && obj1[key] !== null && typeof obj2[key] === 'object' && obj2[key] !== null) {
                // 如果是对象，则递归对比
                differences.push(...diff(obj1[key], obj2[key], fullPath));
            } else if (obj1[key] !== obj2[key]) {
                differences.push(`Value of "${fullPath}" differs: ${obj1[key]} != ${obj2[key]}`);
            }
        }
    }

    // 检查第二个对象的键，确保第一个对象中没有
    for (const key in obj2) {
        if (obj2.hasOwnProperty(key)) {
            const fullPath = path ? `${path}.${key}` : key;
            if (!obj1.hasOwnProperty(key)) {
                differences.push(`Key "${fullPath}" is missing in first JSON.`);
            }
        }
    }

    return differences;
}

// 比较两个 JSON 字符串的函数
diff = function(jsonStr1, jsonStr2) {
    // 将 JSON 字符串转换为 JavaScript 对象
    const obj1 = JSON.stringify(JSON.parse(jsonStr1));
    const obj2 = JSON.stringify(JSON.parse(jsonStr2));


    // 获取并打印所有差异
    const differences = diffInternal(obj1, obj2);

    if (differences.length > 0) {
        console.error('Differences found:');
        differences.forEach(diff => console.log(diff));
    } else {
        console.log('The two JSON strings are identical.');
    }
}

